import React,{Component} from 'react';
import "semantic-ui-css/semantic.min.css"
import{
  Grid

}from "semantic-ui-react";


class App extends Component {
  render(){
    return (
      <div>
        <br />
        <Grid Content columns={2}>
          <Grid.Column width={2}>
          </Grid.Column>
        </Grid>
      </div>
    );
  }
}

export default App;
